import React, { useState } from 'react'
import './search.css';

const Search = () => {
  const [search, setSearch] = useState('');

  return (
    <form className='search'>
      <input 
        type="search" 
        placeholder='Search...' 
        required 
        value={search}
        onChange={e => setSearch(e.target.value)} 
      />

      <button type='submit' className='search-button'>
        Search
      </button>
    </form>
  )
}

export default Search
